8.5增加视频落地页监控：(http://wiki.baidu.com/pages/viewpage.action?pageId=325815887)
一、需求
     对视频落地页进行可靠性监控打点。
      详细：
              对于落地页可能出现的白屏、错误、打不开，插件没加载，视频播放器没出来，以及错误页和视频下发推荐内容加载失败等等问题进行打点上报，可参照图文落地页UBC＝333打点。
二、方案
   复用已有的333可靠性打点，扩展针对视频落地页的错误类型。

三、详细说明
   （一）错误类型扩充：在333打点中视频落地页的错误使用300号段。               
                     301:播放器插件加载失败
                     302:大wifi（包含页面错误、打不开、超时等错误）
                     303: 错误页（前端定制内容错误页）
                     304：播放器下方推荐内容加载失败

    （二）打点值说明：
             301类型：error字段值为
                  {
                       “type”:“301”
                       “desc”: “Plugin Dir: FileName1; FileName2;….”   // 插件安装失败时，上传插件目录信息
                       “msg”: “short/rn”    // 短视频落地页、RN落地页
                 }

              302类型：error字段值为
                 {       
                     “type”:“302”
                     “desc”: “error code值”  // 见文末说明
                     “msg”: “short/rn”
                  }

             303类型、304类型：由视频前端页面通过端能力进行打点上传。  type字段为303、304值，desc和msg字段值不做要求。

             305类型：（8.6 版本增加，20170508 更新！）
             {
               "type" :"305",
               "desc":"1/2",//1:海报url为空，2：海报图片数据为空
               "msg":"short/rm" 
             }
             306类型：（9.1.5 版本增加，20170808 更新！）
             {
               "type" :"306",
               "desc":"1",//1:长视频切换剧集返回错误
               "msg":""//错误信息
             }

    （三）302中 description字段error code值说明
           -1：普通错误，ERROR_UNKNOWN，Generic error   
           -2：找不到host，ERROR_HOST_LOOKUP，Server or proxy hostname lookup failed      
           -3：未支持的授权格式，ERROR_UNSUPPORTED_AUTH_SCHEME，Unsupported authentication scheme (not basic or digest) 
           -4：用户授权错误，ERROR_AUTHENTICATION ，User authentication failed on server
           -5：用户认证失败，ERROR_PROXY_AUTHENTICATION，User authentication failed on proxy
           -6：连接不到server端，ERROR_CONNECT，Failed to connect to the server
           -7：IO错误，ERROR_IO，Failed to read or write to the server
           -8：超时，ERROR_TIMEOUT，Connection timed out
           -9：重定向循环错误，ERROR_REDIRECT_LOOP，Too many redirects
           -10：不支持的URI，ERROR_UNSUPPORTED_SCHEME，Unsupported URI scheme
           -11：SSL握手失败，ERROR_FAILED_SSL_HANDSHAKE，Failed to perform SSL handshake
           -12：URL格式错误， ERROR_BAD_URL， Malformed URL
           -13：文件错误，ERROR_FILE，Generic file error
           -14：找不到文件，ERROR_FILE_NOT_FOUND，File not found      
           -15：请求过多，ERROR_TOO_MANY_REQUESTS，Too many requests during this load

